import React from 'react'
import { Component } from 'react';
import { Link} from 'react-router-dom';
import fondmarin from './images/fondmarin.jpg'
import foret from './images/foret.jpg'
import montagne from './images/montagne.jpg'
import plage from './images/plage.jpg'
import ville from './images/ville.jpg'
import './Wishes.css'



class Wishes extends Component {
    constructor(props){
        super(props)
        this.state = {
          fondmarin : false,
          foret : false,
          montagne : false,
          plage : false,
          ville : false,
        }
      }


      render (){ 
        return (
            <div className="Wishes">
                <h1>Pendant cette période de confinement, il est difficile de s'évader.</h1> 
                <h2>Où voulez-vous vous échapper ?</h2>

                <div className="box">

                    <div className="ligne1">
                        <div className="p1">
                             <h3>Plages</h3>
                             <Link to={{pathname:"/location"}}><img className="photos1" src={plage} alt="Plages"/></Link>
                        </div>

                        <div className="p1">                     
                            <h3>Forêts</h3>
                            <Link to={{pathname:"/location"}}></Link><img className="photos1" src={foret} alt="Forêts"/>
                        </div>

                        <div className="p1"> 
                            <h3>Montagnes</h3>
                            <img className="photos1" src={montagne} alt="Montagnes"/>
                        </div>
                    </div>

                    <div className="ligne2">
                        <div className="p4"> 
                            <h3>Fonds Marins</h3>
                            <img className="photos2" src={fondmarin} alt="Fonds Marins"/>
                        </div>

                        <div className="p5"> 
                            <h3>Villes</h3>
                            <img className="photos2" src={ville} alt="Villes"/>
                        </div>
                    </div>

                </div>
            </div>
        );
    }}


    export default Wishes;


